const func500 = ({ message, briefErr }) =>
  `
    <html lang="zh">
      <head>
        <style>
          textarea {
            border: none;
            outline: none;
            resize: none;
            font-size: 14px;
            width: 1100px;
            height: 350px;
          }
        </style>
      </head>
      <body>
        <div style="text-align: center;">
          <script>
          window.addEventListener('load', function() {
            var $loading = document.querySelector('.initial-loading')
            $loading && $loading.remove()
          })
          </script>
           <img src=${img500} style="margin-top: 20px;" />
           <p style="color: #666; font-size: 14px;">
            ${message}
           </p>
           <p style="color: #666; font-size: 14px;">
            错误接口：${briefErr.url.replace(/\/ops/g, '')}
           </p>
      	</div>
      </body>
    </html>
`

export default function printError(err, ctx) {
  if (err instanceof Error) {
    // js错误，可能是后台返回数据问题，或者循环出现空对象等
    return func500({
      message: `
        <div style="color: red;">系统异常，请联系前端开发人员！</div>
        <textarea disabled>${err.stack}</textarea>
        <br />
      `,
      briefErr: {
        url: ctx.url,
      },
    })
  }
  // 接口错误
  // console.log(err)
  // ctx.res.write(err.message)
  return func500({
    message: `
        <div style="color: red;">网络异常，请联系后端开发人员！</div>
      `,
    briefErr: err.briefErr,
  })
}

const img500 = `
  data:image/jpeg;base64,`
